webpackJsonp([0xa64af020fdc6],{674:function(e,n){e.exports={data:{markdownRemark:{html:'<p>There are times where you don\'t want to accept a program or even after accepting, you decide to leave. Upon leaving a program or declining an invitation, you\'ll be given an opportunity to fill out a questionnaire with your reasons about declining an invitation or leaving the program.</p>\n<h3>Declining an Invitation</h3>\n<p>When you decline an invitation to a private program, you\'ll have the option to fill out a rejection questionnaire to share your feedback with HackerOne.</p>\n<p>At HackerOne we believe in transparency, and in this case, it includes giving programs the reason why hackers aren\'t interested in engaging with them. Your feedback will help programs understand why hackers don\'t want to participate in their programs and can better help them to modify their programs so that hackers will want to hack in them.</p>\n<h3>Leaving a Program</h3>\n<p>Sometimes after looking into a program, you realize it’s not a program you’re interested in participating in. You have the option to leave a program. The <strong>Leave Program</strong> button will appear on the security page of the program you want to leave. To leave the program, click <strong>Leave Program</strong>.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-0ae57.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 34.19257012888552%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="leaving-programs-1"\n        title=""\n        src="/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-2f183.png"\n        srcset="/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-67829.png 125w,\n/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-5c59f.png 250w,\n/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-2f183.png 500w,\n/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-c93e8.png 750w,\n/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-4e628.png 1000w,\n/static/leaving-programs-1-a33d17157e4c9ecef34623e4eb558e4e-0ae57.png 1319w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>After selecting to leave the program, you\'ll get the option to fill out a questionnaire on why you\'ve decided to leave the program. Filling out the questionnaire will put you as a priority for future invites. See: <a href="/hackers/invitations-priority-queue.html">Invitations Priority Queue</a></p>\n<h3>The Feedback Questionnaire</h3>\n<p>To access the questionnaire, decline the invitation or leave the program and the questionnaire will directly appear on your screen.</p>\n<blockquote>\n<p><i>Note: You must fill out the questionnaire immediately. You can\'t save and come back to it later.</i></p>\n</blockquote>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-376a7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.832662912308926%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="invitation-rejection-questionnaire-1"\n        title=""\n        src="/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-2f183.png"\n        srcset="/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-67829.png 125w,\n/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-5c59f.png 250w,\n/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-2f183.png 500w,\n/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-c93e8.png 750w,\n/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-4e628.png 1000w,\n/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-376a7.png 1243w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-42ed1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 174.05329593267885%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="invitation-rejection-questionnaire-2"\n        title=""\n        src="/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-2f183.png"\n        srcset="/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-67829.png 125w,\n/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-5c59f.png 250w,\n/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-2f183.png 500w,\n/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-42ed1.png 713w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The questionnaire is completely voluntary, but if you fill it out, you\'ll get priority for another invitation so that you can find a program that is a better fit.</p>\n<p>If you\'ve rejected an invitation to a program, you can manually be invited back into the program by a program manager.</p>',frontmatter:{title:"Decline Invites and Leave Programs",id:"hackers/decline-invites-and-leave-programs",path:"/hackers/decline-invites-and-leave-programs.html",description:null}}},pathContext:{}}}});
